import React from 'react'
import Input from '@material-ui/core/Input';



const App = () =>{


    return(
        <>
        <div className="wrapper">
            <div className="container">
                <h1 className="heading">To Do List</h1>
                <Input placeholder = "Title"/> <br/>
                <Input placeholder = "Title"/>
            </div>
        </div>
        </>
    )
}


export default App;
